import React from 'react'
import './Events.css'
import Navbar from '../Navbar/Navbar'
import white_arrow from '../../assets/white-arrow.png'

const Events = (event) => {
  return (
    <div className="event">
    <h2>{event.title}jndnsl</h2>
    <p>{event.date}</p>
    <p>{event.description}</p>
  </div>
  );
}

export default Events
